import { useCallback } from "react";

type Props = {
  onDone: () => void;
};

export const AddPants: React.FunctionComponent<Props> = ({onDone}) => {
  const handleSubmit = useCallback((event) => {
    event.preventDefault();
    onDone();
  }, [onDone]);
  return (
    <div>
      <form onSubmit={handleSubmit}>
        <div>
          <label>
            <input name="name" />
          </label>
          <label>
            <input name="color" required />
          </label>
          <label>
            <input name="width" min="1" type="number" />
          </label>
          <label>
            <input name="height" min="1" type="number" />
          </label>
        </div>
        <div>
          <button type="submit">Add</button>
          <button type="button" onClick={onDone}>Cancel</button>
        </div>
      </form>
    </div>
  );
};
